import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";

const CardMoment = (props) => {
  const { img, description } = props;
  console.log(props);
  return (
    <>
      <div>
        <SwiperSlide>
          <img src={img} alt="img" />
        </SwiperSlide>
      </div>
    </>
  );
};

export default CardMoment;
